// import logo from "./logo.svg";
import React from "react";
import { BrowserRouter as Router, Route, Redirect } from "react-router-dom";
import Users from "./User/Pages/User.jsx";
import "./App.css";

function App() {
  return (
    <div>
      <h1>lets start </h1>
      <Router>
        <Route path="/" exact>
          <Users />
        </Route>
        <Redirect to="/" />
      </Router>
    </div>
  );
}

export default App;
